import React, {Component} from 'react';

// import { Container } from './styles';

class Categorias extends Component {
	render() {
		return (
			<div className="table-responsive">
				<table id="categorias" className="table table-striped table-bordered" cellspacing="0" width="100%">
					<thead>
						<tr>
							<th>Titulo</th>
							<th>Descrição</th>
						</tr>
					</thead>
					<tbody>
						<tr>
							<td>Tiger Nixon</td>
							<td>System Architect</td>
						</tr>
					</tbody>
				</table>
			</div>
		);
	}
}


export default Categorias;
